import React from 'react'
import Card from './card.js'

function Listcard(props){
    return(
        <div>
            {
               
                
                props.list.map((cards)=>{
                    return(
                        <Card
                        title={cards.title}
                        description={cards.description}
                        colorLeft={cards.colorLeft}
                        colorRight={cards.colorRight}
                     />
                    )
                })
                
            }
        </div>
    )
}

export default Listcard
